local Ease = require "actions/Ease"
local MessageBox = require "actions/MessageBox"
local Action = require "actions/Action"
local Do = require "actions/Do"
local Wait = require "actions/Wait"

return function(self)
    self.scene.player.by = 10
    if self.scene.invincible then
        return Action()
    end

    if not self.scene.player.waterTouches then
        self.scene.player.waterTouches = 3
    end

    self.scene.invincible = true
    self.scene.player.waterTouches = self.scene.player.waterTouches - 1

    if self.scene.player.waterTouches > 0 then
        return Serial {
            Parallel {
                MessageBox {message = "Sally: Watch where you're going, Sonic!", closeAction = Wait(1)},
                Repeat(
                    Serial {
                        Ease(self.scene.player.sprite.color, 4, 0, 20, "quad"),
                        Ease(self.scene.player.sprite.color, 4, 255, 20, "quad")
                    },
                    10
                )
            },
            Do(function() self.scene.invincible = false end)
        }
    else
        return Serial {
            Parallel {
                Repeat(
                    Serial {
                        Ease(self.scene.player.sprite.color, 4, 0, 20, "quad"),
                        Ease(self.scene.player.sprite.color, 4, 255, 20, "quad")
                    },
                    10
                )
            },
            Do(function()
                self.scene.invincible = false
                self.scene.player.sprite.visible = false
                self.scene.player.dropShadow.sprite.visible = false
                self.scene.player.dead = true
            end)
        }
    end
end

